// Smooth scroll from hero arrow to about section
const scrollBtn = document.getElementById('scroll-down');
if(scrollBtn){
  scrollBtn.addEventListener('click', () => {
    document.getElementById('about').scrollIntoView({behavior:'smooth'});
  });
}

// Dark mode toggle with localStorage persistence
const toggleBtn = document.getElementById('dark-toggle');
if(toggleBtn){
  const applyMode = () => {
    if(localStorage.getItem('darkMode') === 'true'){
      document.body.classList.add('dark');
      toggleBtn.textContent = '☀️';
    }else{
      document.body.classList.remove('dark');
      toggleBtn.textContent = '🌙';
    }
  };
  applyMode();
  toggleBtn.addEventListener('click', () => {
    localStorage.setItem('darkMode', document.body.classList.contains('dark') ? 'false' : 'true');
    applyMode();
  });
}
const resumePdfBase64='';

const resumeLink = document.getElementById('resume-download');
if(resumeLink){
  resumeLink.href = 'data:application/pdf;base64,' + resumePdfBase64;
}
